import React from "react";
import ListItem from "./ListItem";
function List() {
  return (
    <ul className="list-group">
      <ListItem
        id="facebook"
        img="https://picsum.photos/200/300"
        name="Facebook"
      />
      <ListItem
        id="youtube"
        img="https://picsum.photos/200/300"
        name="Youtube"
      />
      <ListItem
        id="linkedin"
        img="https://picsum.photos/200/300"
        name="LinkedIn"
      />
    </ul>
  );
}
export default List;
